import React from "react";
import Editor from "../Dashboard/components/add-new-post/Editor";
import ReactQuill from "react-quill";
import { Card, CardBody, Form, FormInput, Button } from "shards-react";
import AdminDashboard from ".";
import "./CSS/addBlog.css";

// import PageTitle from "../Dashboard/components/common/PageTitle";
// import SidebarActions from "../Dashboard/components/add-new-post/SidebarActions";
// import SidebarCategories from "../Dashboard/components/add-new-post/SidebarCategories";
function AddBlogPost() {
  return (
    <div>
      <AdminDashboard />
      <Card small className="addForm">
        <CardBody>
          <Form className="add-new-post">
            <FormInput
              size="lg"
              className="mb-3"
              placeholder="Your Post Title"
            />
            <ReactQuill className="add-new-post__editor mb-1" />
          </Form>
        </CardBody>
      </Card>
      {/* <Button>Publish</Button> */}
      <div style={{textAlign:"center"}}><button style={{marginTop:"2em"}}>Send</button></div>
      {/* <div style={{textAlign:"center"}}>Test</div> */}
    </div>
  );
}

export default AddBlogPost;
